import styled from "styled-components";
import { motion } from "framer-motion";
import AuthorComponent from "./author.component";

const SecondArticleComponentstyStyle = styled(motion.div)`
  width: calc(90vw - 100px);
  margin-left: 5vw;
  margin-top: 150px;
  background-color: #f8f8ff;
  padding: 50px;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  padding-top: 30px;
  height: auto;
  position: relative;
  .articels {
    position: relative;
    width: 600px;
    background-color: lawngreen;
    display: flex;
    flex-direction: column;
    height: auto;
    .article {
      display: flex;
      height: auto;
      flex-direction: row;
      justify-content: space-between;
      .articleCover {
        height: 150px;
        width: 200px;
        background-color: lightcoral;
      }
      .articleDeatils {
        width: 350px;
        height: auto;
        position: relative;
        display: flex;
        flex-direction: column;
        background-color: lightgray;
        .title {
          font-size: 20px;
          display: flex;
          justify-content: space-between;
          .mainTitle {
            color: #1b1811;
          }
          .articleType {
            color: #679267;
          }
        }
      }
    }
  }
`;

const SecondArticleComponent = () => {
  return (
    <SecondArticleComponentstyStyle>
      <div className="articels ">
        <div className="article">
          <div className="articleDeatils">
            <div className="title">
              <span className="mainTitle">some title here</span>
              <span className="articleType"> health </span>
            </div>
            <span className="title"></span>
            <span className="subTitle">
              some title here some title here some title here some title here
              some title here
            </span>
            <AuthorComponent />
          </div>
          <div className="articleCover" />
        </div>
      </div>
      <div className="tags"></div>
    </SecondArticleComponentstyStyle>
  );
};
export default SecondArticleComponent;
